import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule, ReactiveFormsModule } from '@angular/forms'; // Asegúrate de importar FormsModule

import { AppComponent } from './app.component';
import { InicioComponent } from './pages/inicio/inicio.component';
import { CrearComponent } from './pages/crear/crear.component';
import { MenuComponent } from './pages/menu/menu.component';
import { AppRoutingModule } from './app-routing.module';
import { NosotrosComponent } from './pages/nosotros/nosotros.component';
import { RecetasComponent } from './pages/leer/recetas.component';
import { provideFirebaseApp, getApp, initializeApp } from '@angular/fire/app';
import { getFirestore, provideFirestore } from '@angular/fire/firestore';
import { environment } from 'src/environments/environments';
import { FIREBASE_APP_NAME, FIREBASE_OPTIONS } from '@angular/fire/compat';
import { RecetasService } from './recetas.service';
import { RecetasFirebaseService } from './services/recetas-firebase.service';
import { ViewRecetaComponent } from './pages/view-receta/view-receta.component';

@NgModule({
  declarations: [
    AppComponent,
    InicioComponent,
    CrearComponent,
    MenuComponent,
    NosotrosComponent,
    RecetasComponent,
    ViewRecetaComponent
  ],
  imports: [
    provideFirebaseApp(() => initializeApp( environment.firebaseConfig )),
    provideFirestore(() => getFirestore()),
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    ReactiveFormsModule,
    provideFirebaseApp(() => initializeApp({"projectId":"practica-86363","appId":"1:179776909827:web:90f9107857c31e0da3d436","storageBucket":"practica-86363.appspot.com","apiKey":"AIzaSyDhykvG47RIHyo-0Tqk0FnxYOm-R_fVTrE","authDomain":"practica-86363.firebaseapp.com","messagingSenderId":"179776909827","measurementId":"G-0HPLJJJXP0"}))
  ],
  providers: [{ provide: FIREBASE_OPTIONS, useValue: environment.firebaseConfig }, RecetasFirebaseService],
  bootstrap: [AppComponent]
})
export class AppModule { }
